/// <reference types="node" />
/**
 * Return true if the warning should not be emitted, false to pass onto the next filter or back to node if there are no more filters.
 */
declare type FilterFunction = (...args: Parameters<typeof process["emitWarning"]>) => boolean;
declare function SuppressWarnings(opt?: FilterFunction[], whitelist?: boolean): void;
export = SuppressWarnings;
